import React from 'react';
import { Trypewriter } from 'typewriter-effect';

const Jumbotron = ({ text }) => {
    <Trypewriter
        options={{
            strings: text,
            autoStart: true,
            loop: true,
        }}
    />;
};

export default Jumbotron;
